INSERT INTO `auto_response` VALUES (1,'default reply (after new ticket has been created)','This is a demo text which is send to every inquiry.\nIt could contain something like:\n\nThanks for your email. A new ticket has been created.\n\nYou wrote:\n<OTRS_CUSTOMER_EMAIL[6]>\n\nYour email will be answered by a human ASAP\n\nHave fun with OTRS! :-)\n\nYour OTRS Team\n','RE: <OTRS_CUSTOMER_SUBJECT[24]>',1,1,'text/plain','',1,'2019-08-03 12:46:28',1,'2019-08-03 12:46:28',1),(2,'default reject (after follow-up and rejected of a closed ticket)','Your previous ticket is closed.\n\n-- Your follow-up has been rejected. --\n\nPlease create a new ticket.\n\nYour OTRS Team\n','Your email has been rejected! (RE: <OTRS_CUSTOMER_SUBJECT[24]>)',2,1,'text/plain','',1,'2019-08-03 12:46:28',1,'2019-08-03 12:46:28',1),(3,'default follow-up (after a ticket follow-up has been added)','Thanks for your follow-up email\n\nYou wrote:\n<OTRS_CUSTOMER_EMAIL[6]>\n\nYour email will be answered by a human ASAP.\n\nHave fun with OTRS!\n\nYour OTRS Team\n','RE: <OTRS_CUSTOMER_SUBJECT[24]>',3,1,'text/plain','',1,'2019-08-03 12:46:28',1,'2019-08-03 12:46:28',1),(4,'default reject/new ticket created (after closed follow-up with new ticket creation)','Your previous ticket is closed.\n\n-- A new ticket has been created for you. --\n\nYou wrote:\n<OTRS_CUSTOMER_EMAIL[6]>\n\nYour email will be answered by a human ASAP.\n\nHave fun with OTRS!\n\nYour OTRS Team\n','New ticket has been created! (RE: <OTRS_CUSTOMER_SUBJECT[24]>)',4,1,'text/plain','',1,'2019-08-03 12:46:28',1,'2019-08-03 12:46:28',1);
/*!40000 ALTER TABLE `auto_response` ENABLE KEYS */;
