INSERT INTO `notification_event_message` VALUES (1,1,'Ticket Created: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been created in queue <OTRS_TICKET_Queue>.\n\n<OTRS_CUSTOMER_REALNAME> wrote:\n<OTRS_CUSTOMER_BODY[30]>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(2,2,'Unlocked Ticket Follow-Up: <OTRS_CUSTOMER_SUBJECT[24]>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe unlocked ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] received a follow-up.\n\n<OTRS_CUSTOMER_REALNAME> wrote:\n<OTRS_CUSTOMER_BODY[30]>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(3,3,'Locked Ticket Follow-Up: <OTRS_CUSTOMER_SUBJECT[24]>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe locked ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] received a follow-up.\n\n<OTRS_CUSTOMER_REALNAME> wrote:\n<OTRS_CUSTOMER_BODY[30]>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(4,4,'Ticket Lock Timeout: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has reached its lock timeout period and is now unlocked.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(5,5,'Ticket Owner Update to <OTRS_OWNER_UserFullname>: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe owner of ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been updated to <OTRS_TICKET_OWNER_UserFullname> by <OTRS_CURRENT_UserFullname>.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(6,6,'Ticket Responsible Update to <OTRS_RESPONSIBLE_UserFullname>: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe responsible agent of ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been updated to <OTRS_TICKET_RESPONSIBLE_UserFullname> by <OTRS_CURRENT_UserFullname>.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(7,7,'Ticket Note: <OTRS_AGENT_SUBJECT[24]>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\n<OTRS_CURRENT_UserFullname> wrote:\n<OTRS_AGENT_BODY[30]>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(8,8,'Ticket Queue Update to <OTRS_TICKET_Queue>: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been updated to queue <OTRS_TICKET_Queue>.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(9,9,'Locked Ticket Pending Reminder Time Reached: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe pending reminder time of the locked ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been reached.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(10,10,'Unlocked Ticket Pending Reminder Time Reached: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe pending reminder time of the unlocked ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been reached.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(11,11,'Ticket Escalation! <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] is escalated!\n\nEscalated at: <OTRS_TICKET_EscalationDestinationDate>\nEscalated since: <OTRS_TICKET_EscalationDestinationIn>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(12,12,'Ticket Escalation Warning! <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] will escalate!\n\nEscalation at: <OTRS_TICKET_EscalationDestinationDate>\nEscalation in: <OTRS_TICKET_EscalationDestinationIn>\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(13,13,'Ticket Service Update to <OTRS_TICKET_Service>: <OTRS_TICKET_Title>','Hi <OTRS_NOTIFICATION_RECIPIENT_UserFirstname>,\n\nthe service of ticket [<OTRS_CONFIG_Ticket::Hook><OTRS_TICKET_TicketNumber>] has been updated to <OTRS_TICKET_Service>.\n\n<OTRS_CONFIG_HttpType>://<OTRS_CONFIG_FQDN>/<OTRS_CONFIG_ScriptAlias>index.pl?Action=AgentTicketZoom;TicketID=<OTRS_TICKET_TicketID>\n\n-- <OTRS_CONFIG_NotificationSenderName>','text/plain','en'),(14,1,'Ticket e